import React from 'react';
import { logo, tags, informations } from '../../utils/utils.functions';
import '../../scss/HeaderMobile.scss';

const HeaderMobile = () => {
  return (
    <div style={{ color: 'white' }}>
      <img src={logo} alt="aa" />
      <div>
        {tags.closingTagName}
        {informations.name}
      </div>
      <ul className="burger-nav">
        <li className="hamburger-nav"></li>
        <li className="hamburger-nav"></li>
        <li className="hamburger-nav"></li>
      </ul>
    </div>
  );
};

export default HeaderMobile;
